import Navigation from '../Components/Navigation'
import "../styles.css"
import "./Media/volunteer.png"



export default function Home(){
    return(
        <div>
            <Navigation />
            <h2 className="center-text">Home Page</h2><br/>
            <img src="volunteer.png" alt="volunteerLogo" ></img>
            <p className="center-text"> Bottom text</p>
        </div>
    )
}
